// src/components/AdminNavbar.jsx
import React from "react";
import { Link, useNavigate } from "react-router-dom";

const AdminNavbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("adminToken");
    navigate("/admin/login");
  };

  return (
    <nav style={{ padding: 10, background: "#333", color: "#fff" }}>
      <Link to="/admin/dashboard" style={{ marginRight: 10, color: "#fff" }}>
        Dashboard
      </Link>
      <Link to="/admin/courses" style={{ marginRight: 10, color: "#fff" }}>
        Courses
      </Link>
      <Link to="/admin/lectures" style={{ marginRight: 10, color: "#fff" }}>
        Lectures
      </Link>
      <Link to="/admin/instructors" style={{ marginRight: 10, color: "#fff" }}>
        Instructors
      </Link>
      <button onClick={handleLogout} style={{ float: "right" }}>
        Logout
      </button>
    </nav>
  );
};

export default AdminNavbar;
